import React from "react";

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>&copy; 2024 Fresh SuperMarket. All rights reserved.</p>
    </footer>
  );
};

const styles = {
  footer: { textAlign: "center",height:"34px" ,padding: "10px", background: " #BDBDBD", position: "relative" ,top:"590px"},
};

export default Footer;
